                                          </div>
                                        </div>
                                      </div>
                                    </div>
                                  </div>
                                </div>
                                <div className="line-separator" />
                              </div>
                              <div className="checkout-price-detail-container">
                                <div>
                                  <div className="checkout-price-detail-cell">
